import React from 'react'
import './Header.css'
const Header = () => {
  const headerStyle = {
    width: '100%',
    height: '80px',
    background: 'linear-gradient(45deg, #f7b733, #fc4a1a, #d42c5c, #8e44ad)',
    backgroundSize: '300% 300%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    animation: 'gradientAnimation 5s infinite',
  };

  return (
    <div className='outDiv' style={headerStyle}>
        <div className='inDiv'>Header</div>
    </div>
  )
}

export default Header
